      <text id="121" justification="0" size="4" underlined="false">
        <text>There are 3 basic deployment diagrams,
&lt;b&gt;Top)&lt;/b&gt; The most simple that will have scaleability issues
   after the single server limit is reached.
&lt;b&gt;Middle)&lt;/b&gt; The most secure, since no inbound ports
   should need to be open, cracking would only be
   available though the application.
&lt;b&gt;Bottom)&lt;/b&gt; The cheapest to scale since
everything could be cloud based.  This occurs since cloud
companines can compete based on metrics needed.
i.e. rapsberry-pi java based servers in the cloud
with any option for private or cloud storage.</text>
